    protected async override void OnInitialized()
    {
        Email = await sessionStorage.GetItemAsync<string>("Email");
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        FinancialYearId = await sessionStorage.GetItemAsync<long>("FinancialYearId");
        UserId = await sessionStorage.GetItemAsync<long>("UserId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Toaster.Add("You dont have to privilege.", MatToastType.Success, "dashboard", null);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        LoadData();
        StateHasChanged();
    }
    protected void LoadData()
    {
        unit = productRepository.ViewAllProduct(CompanyId);
        StateHasChanged();
    }
    private bool FilterFunc(ProductView element)
    {
        if (string.IsNullOrWhiteSpace(searchString))
            return true;
        if (element.ProductCode.Contains(searchString, StringComparison.OrdinalIgnoreCase))
            return true;
        if (element.ProductName.Contains(searchString, StringComparison.OrdinalIgnoreCase))
            return true;
        if (element.GroupName.Contains(searchString, StringComparison.OrdinalIgnoreCase))
            return true;
        return false;
    }
    async Task Delete(long id)
    {
        bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
        if (confirmed)
        {
            bool isSave = false;
            isSave = productRepository.DeleteProduct(id);
            if (isSave == true)
            {
                Toaster.Add("Delete Successfully.", MatToastType.Info, "Product List", null);
                LoadData();
                navManager.NavigateTo("inventory/productlist");
            }
            else
            {
                Toaster.Add("Cannot be delete. already in used.", MatToastType.Info, "Product List", null);
                navManager.NavigateTo("inventory/productlist");
            }
        }
    }
    protected async Task GenerateExcel()
    {
        IWorkbook workbook = new XSSFWorkbook();
        var dataFormat = workbook.CreateDataFormat();
        var dataStyle = workbook.CreateCellStyle();
        dataStyle.DataFormat = dataFormat.GetFormat("MM/yy/dddd HH:mm:ss");
        ISheet worksheet = workbook.CreateSheet("Sheet1");



        int rowNumber1 = 0;
        IRow row1 = worksheet.CreateRow(rowNumber1++);
        //TbleHeder
        ICell cell1 = row1.CreateCell(3);
        cell1.SetCellValue("ProductList");

        int rowNumber = 1;
        IRow row = worksheet.CreateRow(rowNumber++);
        //TbleHeder
        ICell cell = row.CreateCell(0);
        cell.SetCellValue("Code");

        cell = row.CreateCell(1);
        cell.SetCellValue("Product");

        cell = row.CreateCell(2);
        cell.SetCellValue("Group");

        cell = row.CreateCell(3);
        cell.SetCellValue("Unit");

        cell = row.CreateCell(4);
        cell.SetCellValue("Purchase Rate");

        cell = row.CreateCell(5);
        cell.SetCellValue("Sales Rate");

        cell = row.CreateCell(6);
        cell.SetCellValue("Mrp");


        //Tble Body
        foreach (var objDue in unit)
        {
            row = worksheet.CreateRow(rowNumber++);

            cell = row.CreateCell(0);
            cell.SetCellValue(objDue.ProductCode);

            cell = row.CreateCell(1);
            cell.SetCellValue(objDue.ProductName);

            cell = row.CreateCell(2);
            cell.SetCellValue(objDue.GroupName);

            cell = row.CreateCell(3);
            cell.SetCellValue(objDue.UnitName);

            cell = row.CreateCell(4);
            cell.SetCellValue(objDue.PurchaseRate.ToString());

            cell = row.CreateCell(5);
            cell.SetCellValue(objDue.SalesRate.ToString());

            cell = row.CreateCell(6);
            cell.SetCellValue(objDue.Mrp.ToString());

        }
        MemoryStream ms = new MemoryStream();
        workbook.Write(ms);
        byte[] bytes = ms.ToArray();
        ms.Close();

        await JsRuntime.SaveAsFileAsync("ProductList", bytes, "application/vnd.ms-excel");
    }

